@ptn・8 pushed a small hotfix - 4.4.1

it evens out initial miner scores provided as they don't have a set EMA yet. If a miner somehow is capable of predicting that a big move is coming, they can join the network before that move and get rewarded more heavily for having accurate predictions for the predicted move. Its a corner case as predicting that a move is coming then nailing the move is very hard to do, but it helps mitigate this scenario. 

Validators will need to update their machines. f you're running the run.sh script it should auto-update.

@ptn・8 pushed hotfix 4.4.2

validator was found storing a bad predictiondatafile ( @WildMax ). Fix should remove any badly stored data files when retrieving to score. 

