@ptn・8 R6.0.1 live

We've pushed Feature Set Creator (FSC) to mainnet. This includes model V5 for all miners. 

We are also no longer only reliant on Binance data for the validator side, we now use FSC to power our validators. We use Binance, Coinbase Pro, and Bybit together in order to determine closing prices to compare against miner results. With this reliable system, if one of the exchanges goes down we can still reliably score results using the other available exchanges.

@ptn・8 hotfix R6.0.4 

I will provide an RCA (root cause analysis) on this bug. For now, the validators should be working properly. Please let me know if you see any errors and we'll address.

We'll have another hotfix out to finalize changes for RCA as well.

